#include <cstdio>
#include <cstring>
#include <iostream>
using namespace std;
#define MAX 1000005

int a[MAX];

//提取从st 到 end 之间的幸运数
int* record(int st,int end,int b[])
{
	int k = st;
	int t = b[st];

	for(int i = st; i < end; ++i)
		if((i+1) % t != 0)
		{
			b[k] = b[i];
			k++;
		}
	if(t < end)
		return record(st+1,end,b);
	else
		return b;
}
int main()
{
	int m,n,mid;
	int cnt  = 0;

	scanf("%d%d",&m,&n);
	mid = n/2 + 10;

	for(int i = 0; i < mid; ++i)
		a[i] = i*2 + 1;
	record(1,mid,a);

	for(int i = 0; i < mid; ++i) //统计位于n-m之间的幸运数个数
	{
		if(a[i] > n) 
			break;
		if(a[i] > m && a[i] < n)
			cnt++;
	}
	cout<<cnt<<endl;

	return 0;
}

